import Header from "../../components/header/Header";
import "./Routines.css";
import routines from "../../helpers/data";



function Routines() {
    return (
        <>
            <header><Header /></header>
            <body>
                <div className="container">
                    {routines.map(routine => (
                        <a>{routine.title}</a>
                    ))}
                </div>
            </body>
        </>
    );
}

export default Routines;
